        public override void OnSearch()
        {
            if (tabControlSearch.SelectedTab == tpgSuchen)
              {
                  foreach (Control ctl in UtilsGui.AllControls(tpgSuchen))
                  {
                      if (ctl is KissButtonEdit)
                      {
                          KissButtonEdit edt = (KissButtonEdit)ctl;
                          edt.CheckPendingSearchValue();
                      }
                  }

                    // Wenn Von eingegeben wurde, aber Bis nicht, dann kopiere Von nach Bis
                    if (!DBUtil.IsEmpty(edtSucheBelegNrVon.EditValue) && DBUtil.IsEmpty(edtSucheBelegNrBis.EditValue) )
                    {
                        edtSucheBelegNrBis.EditValue = edtSucheBelegNrVon.EditValue;
                    }

                    // Wenn Bis eingegeben wurde, aber Vob nicht, dann kopiere Bis nach Von
                    if (!DBUtil.IsEmpty(edtSucheBelegNrBis.EditValue) && DBUtil.IsEmpty(edtSucheBelegNrVon.EditValue) )
                    {
                        edtSucheBelegNrVon.EditValue = edtSucheBelegNrBis.EditValue;
                    }

                  if (edtSucheBuchungsDatumVon.DateTime > edtSucheBuchungsDatumBis.DateTime)
                  {
                      KissMsg.ShowInfo("'Buchungsdatum von' kann nicht nach 'Buchungsdatum bis' sein");
                      return;
                  }

                  if (edtSucheVerwPeriodeVon.DateTime > edtSucheVerwPeriodeBis.DateTime)
                  {
                      KissMsg.ShowInfo("'Verwendungsperiode von' kann nicht nach 'Verwendungsperiode bis' sein");
                      return;
                  }

                  if (DBUtil.IsEmpty(edtMaxBelege.EditValue))
                  {
                      edtMaxBelege.EditValue = 100;
                  }

                  grdWNettoBelege.View.ClearColumnsFilter();
                  grdWBruttoBelege.View.ClearColumnsFilter();
                }

            base.OnSearch();
        }

