        private void SprungWBudgetPosition(SqlQuery query)
        {
            if (!DBUtil.IsEmpty(query["BgPositionID"]))
             {
                 SqlQuery qrytemp = DBUtil.OpenSQL(@"
                      SELECT FAL.BaPersonID, BFP.BgFinanzplanID, BBG.BgBudgetID, BPO.BgPositionID
                      FROM BgPosition BPO
                         INNER JOIN BgBudget      BBG ON BBG.BgBudgetID = BPO.BgBudgetID
                         INNER JOIN BgFinanzplan  BFP ON BFP.BgFinanzplanID = BBG.BgFinanzplanID
                         INNER JOIN FaLeistung    FLE ON FLE.FaLeistungID = BFP.FaLeistungID
                         INNER JOIN FaFall        FAL ON FAL.FaFallID = FLE.FaFallID
                      WHERE BPO.BgPositionID = {0}",
                      query["BgPositionID"]);

                 string jumpToPath = string.Format(
                      "ClassName=FrmFall;" +
                      "BaPersonID={0};" +
                      "ModulID=3;" +
                      "TreeNodeID=CtlWhFinanzplan{1}\\BBG{2};" +
                      "ActiveSQLQuery.Find=BgPositionID = {3};",
                      qrytemp["BaPersonID"],
                      qrytemp["BgFinanzplanID"],
                      qrytemp["BgBudgetID"],
                      qrytemp["BgPositionID"]);

                 System.Collections.Specialized.HybridDictionary dic = FormController.ConvertToDictionary(jumpToPath);
                 bool result = FormController.OpenForm((string)dic["ClassName"], "Action", "JumpToPath", dic);
                 // resultat ist eigentlich immer true
                 if (!result)
                 {
                     KissMsg.ShowInfo("Die Position befindet sich in einer beendeten Reg. WH oder in einem abgeschlossenen W. Deaktivieren Sie die Optionen 'Beendete Reg. WH ausblenden' und 'Abgeschlossene W ausblenden' um die Position anzuzeigen.");
                     jumpToPath = string.Format(
                          "ClassName=FrmFall;" +
                          "BaPersonID={0};" +
                          "ModulID=3;" +
                          "TreeNodeID=CtlWhKontoauszug;"
                          , qrytemp["BaPersonID"]);
                     dic = FormController.ConvertToDictionary(jumpToPath);
                     FormController.OpenForm((string)dic["ClassName"], "Action", "JumpToPath", dic);
                 }
             }
        }

        private void SprungWMontagsBudget(SqlQuery query)
        {
            if (!DBUtil.IsEmpty(query["BgBudgetID"]))
            {
                SqlQuery qrytemp = DBUtil.OpenSQL(@"
                    SELECT FAL.BaPersonID, FLE.ModulID, BFP.BgFinanzplanID
                    FROM BgBudget              BBG
                      INNER JOIN BgFinanzplan  BFP ON BFP.BgFinanzplanID = BBG.BgFinanzplanID
                      INNER JOIN FaLeistung    FLE ON FLE.FaLeistungID = BFP.FaLeistungID
                      INNER JOIN FaFall        FAL ON FAL.FaFallID = FLE.FaFallID
                    WHERE BBG.BgBudgetID = {0}",
                    query["BgBudgetID"]);

                if (qrytemp.Count == 1)
                {
                    string jumpToPath = string.Format(
                        "ClassName=FrmFall;BaPersonID={0};ModulID={1};TreeNodeID=CtlWhFinanzplan{2}\\BBG{3}",
                        qrytemp["BaPersonID"],
                        qrytemp["ModulID"],
                        qrytemp["BgFinanzplanID"],
                        query["BgBudgetID"]);

                    System.Collections.Specialized.HybridDictionary dic = FormController.ConvertToDictionary(jumpToPath);
                    bool result = FormController.OpenForm((string)dic["ClassName"], "Action", "JumpToPath", dic);
                }
            }
        }

